import React from "react";
import { Container, Col, Row, Image } from "react-bootstrap";
import layerCake from "../assets/RyanHunter/layercakexjm-15.JPG";
import layerCake11 from "../assets/RyanHunter/layercakexjm-11.JPG";
import layerCake19 from "../assets/RyanHunter/layercakexjm-19.JPG";
import layerCake23 from "../assets/RyanHunter/layercakexjm-23.JPG";
export default function CollabDetail() {
  return (
    <>
      <Container className="p-3">
        <Row xs={1} md={1} lg={1}>
          <Col md={true}>
            <Image
              thumbnail
              src={layerCake}
              alt="LayerCake"
              width="100%"
              height="100%"
            />
          </Col>
        </Row>
        <Row xs={3} md={3} lg={3}>
          <Col>
            <Image
              src={layerCake11}
              alt="LayerCake"
              width="100%"
              height={100}
            />
          </Col>
          <Col>
            <Image
              src={layerCake19}
              alt="LayerCake"
              width="100%"
              height={100}
            />
          </Col>
          <Col>
            <Image
              src={layerCake23}
              alt="LayerCake"
              width="100%"
              height={100}
            />
          </Col>
        </Row>
      </Container>
    </>
  );
}
